import { AppartList } from "../../Datas/AppartList"


function AppartCard ({ title , cover }) {

    return (
    <div  className='appart-card'>
        {AppartList.map((logement) => 
            <a key= {logement.id} href="/Logements">
                <img className='appart-img' src={cover} alt={{title}} />
                <p>{title}</p>
            </a>)}

    </div>
)


}

export default AppartCard
